import {  Routes, Route } from "react-router-dom";
import App from './App';
import Profile from './Profile';


function HomePage() {
  return (

      <Routes>
        <Route  path="/" component={App} />
        <Route  path="/profile" component={Profile} />     
      </Routes>

  );
}

export default HomePage;


